import React from 'react';
import DayTable from './React.day.table';
import DayChart from './React.day.chart';
import FindReports from './React.reports.find';
import 'react-vis/dist/style.css';
import '../css/main.css';

class DayWorkspace extends React.Component {

    render() {
        return (
            <div>
                <Userbar presentRows={this.state.charts} find={this.findCharts} />
                <div className="chart">
                    <h2>Суточный мониторинг нагрузки на систему</h2>
                    <DayChart chartDay={this.props.chartDay} />
                </div>
                <div className="data">
                    <h2>Показатели активности по часам</h2>
                    <DayTable rows={this.props.tableDay} />
                </div>
            </div>
        );
    }
}

export default DayWorkspace;
